import React , { Component} from  'react';
import DemographicsData from './demographics';
import DevicesData from './devices';

class Charts extends Component {
    render () {
        return (
            <div>
                <DemographicsData/>
                <DevicesData/>
            </div>
        )
    }
}
export default Charts;
